WINDOW_ICON_BASE64 = """

"""

BACKGROUND_IMAGE_BASE64 = """

"""

class WorkerThread(QThread):
    progress = pyqtSignal(int, str)
    finished = pyqtSignal(str)
    error = pyqtSignal(str)

    def __init__(self, youtube_url, openai_key):
        super().__init__()
        self.youtube_url = youtube_url
        self.openai_key = openai_key
        if os.path.exists('config/prompt.ini'):
            with open('config/prompt.ini', 'r') as f:
                self.ai_instructions = f.read()
        else:
            self.ai_instructions = "Please analyze the following transcription: {transcription}"

    def run(self):
        try:
            self.progress.emit(0, "Starting analysis...")
            self.progress.emit(10, "Downloading video...")
            audio_file, video_title = self.download_audio()

            self.progress.emit(30, "Transcribing audio...")
            transcript = self.transcribe_audio(audio_file)
            formatted_transcript = self.format_transcript(transcript)

            self.progress.emit(60, "Analyzing content with ChatGPT...")
            analysis = self.analyze_transcription(formatted_transcript)

            self.progress.emit(90, "Generating report...")
            report_path = self.generate_html_report(formatted_transcript, analysis, video_title)

            self.progress.emit(100, "Analysis complete!")
            self.finished.emit(report_path)

        except Exception as e:
            self.error.emit(str(e))

    def download_audio(self, download_path='downloads'):
        if not os.path.exists(download_path):
            os.makedirs(download_path)

        ydl_opts = {
            'format': 'bestaudio/best',
            'outtmpl': os.path.join(download_path, '%(title)s.%(ext)s'),
            'postprocessors': [{
                'key': 'FFmpegExtractAudio',
                'preferredcodec': 'mp3',
                'preferredquality': '192',
            }],
            'quiet': True,
            'no_warnings': True,
        }

        with yt_dlp.YoutubeDL(ydl_opts) as ydl:
            info_dict = ydl.extract_info(self.youtube_url, download=True)
            audio_file = ydl.prepare_filename(info_dict)
            base, ext = os.path.splitext(audio_file)
            audio_file = base + '.mp3'

        return audio_file, info_dict.get('title', 'Untitled')

    def transcribe_audio(self, audio_path, model_size='base'):
        model = whisper.load_model(model_size)
        result = model.transcribe(audio_path)
        return result['text']

    def format_transcript(self, text, max_sentences=15):
        sentences = re.split(r'(?<=[.!?]) +', text)
        paragraphs = []
        current_paragraph = []

        for sentence in sentences:
            current_paragraph.append(sentence)
            if len(current_paragraph) >= max_sentences:
                paragraphs.append(' '.join(current_paragraph))
                current_paragraph = []

        if current_paragraph:
            paragraphs.append(' '.join(current_paragraph))

        return '\n\n'.join(paragraphs)

    def analyze_transcription(self, transcript):
        openai.api_key = self.openai_key
        prompt = f"{self.ai_instructions}\n\nTranscription:\n{transcript}"

        response = openai.ChatCompletion.create(
            model="chatgpt-4o-latest",
            messages=[
                {"role": "system", "content": "Do what the instructions say. Produce ONLY HTML output but NEVER code blocks."},
                {"role": "user", "content": prompt}
            ],
            max_tokens=1500,
            temperature=0.7,
        )

        return response['choices'][0]['message']['content'].strip()

    def generate_html_report(self, transcript, analysis, video_title):
        report_path = 'report.html'
        paragraphs = transcript.split('\n\n')
        escaped_paragraphs = [html.escape(p) for p in paragraphs]
        formatted_transcript = ''.join(f'<p>{p}</p>' for p in escaped_paragraphs)

        html_content = f"""<!DOCTYPE html>
    <html lang="en">
    <head>
        <meta charset="UTF-8">
        <title>{html.escape(video_title)} - Analysis Report</title>
        <style>
            body {{ font-family: Arial, sans-serif; margin: 0; padding: 0; background: #1a1a1a; color: #ffffff; }}
            .header {{ background: #2d2d2d; padding: 20px; text-align: center; }}
            .container {{ max-width: 1200px; margin: 0 auto; padding: 20px; }}
            .tab-content {{ background: #2d2d2d; padding: 20px; border-radius: 5px; margin-top: 20px; position: relative; }}
            h1, h2 {{ color: #bb86fc; }}
            p {{ line-height: 1.6; }}
            .copy-btn {{
                position: absolute;
                top: 20px;
                right: 20px;
                background: #bb86fc;
                color: #000000;
                border: none;
                border-radius: 4px;
                padding: 8px 16px;
                cursor: pointer;
            }}
            .copy-btn:hover {{ background: #9969da; }}
        </style>
        <script>
            function copyToClipboard(elementId) {{
                const text = document.getElementById(elementId).innerText;
                navigator.clipboard.writeText(text).then(() => {{
                    alert('Copied to clipboard!');
                }}).catch(err => {{
                    alert('Failed to copy: ' + err);
                }});
            }}
        </script>
    </head>
    <body>
        <div class="header">
            <h1>{html.escape(video_title)}</h1>
        </div>
        <div class="container">
            <div class="tab-content">
                <h2>Transcript</h2>
                <button class="copy-btn" onclick="copyToClipboard('transcript')">Copy</button>
                <div id="transcript">{formatted_transcript}</div>
            </div>
            <div class="tab-content">
                <h2>AI Output</h2>
                <button class="copy-btn" onclick="copyToClipboard('ai-output')">Copy</button>
                <div id="ai-output">{analysis}</div>
            </div>
        </div>
    </body>
    </html>"""

        with open(report_path, 'w', encoding='utf-8') as f:
            f.write(html_content)
        return report_path


class BackgroundWidget(QWidget):
    def __init__(self, image_base64, parent=None):
        super().__init__(parent)
        self.image_base64 = image_base64
        self.init_image()

    def init_image(self):
        image_data = base64.b64decode(self.image_base64)
        self.background_image = QPixmap()
        self.background_image.loadFromData(image_data)

    def paintEvent(self, event):
        painter = QPainter(self)
        painter.setOpacity(0.07)
        painter.drawPixmap(self.rect(), self.background_image)
        super().paintEvent(event)


class MainWindow(QMainWindow):
    def __init__(self):
        super().__init__()
        self.init_ui()
        self.load_config()

    def init_ui(self):
        # Decode and set the window icon
        icon_data = base64.b64decode(WINDOW_ICON_BASE64)
        pixmap = QPixmap()
        pixmap.loadFromData(icon_data)
        self.setWindowIcon(QIcon(pixmap))

        # Rest of the UI initialization code
        self.setWindowTitle('NovaTube - YouTube Analyzer')
        self.setStyleSheet("""
            QMainWindow { background-color: #1a1a1a; }
            QWidget { background-color: transparent; color: #ffffff; }
            QLineEdit, QTextEdit { 
                background-color: #2d2d2d; 
                color: #ffffff; 
                border: 1px solid #bb86fc;
                border-radius: 4px;
                padding: 5px;
            }
            QPushButton { 
                background-color: #bb86fc; 
                color: #000000; 
                border: none;
                border-radius: 4px;
                padding: 8px 16px;
                font-weight: bold;
            }
            QPushButton:hover { background-color: #9969da; }
            QLabel { color: #ffffff; }
            QProgressBar {
                border: 1px solid #bb86fc;
                border-radius: 4px;
                text-align: center;
            }
            QProgressBar::chunk {
                background-color: #bb86fc;
            }
            QTabWidget::pane { 
                border: none; 
                background-color: #1a1a1a; 
            }
            QTabBar::tab { 
                background-color: #2d2d2d; 
                color: #ffffff; 
                padding: 10px; 
                border-top-left-radius: 4px;
                border-top-right-radius: 4px;
                min-width: 100px;
            }
            QTabBar::tab:selected { 
                background-color: #bb86fc; 
                color: #000000; 
            }
        """)

        main_widget = QWidget()
        self.setCentralWidget(main_widget)
        layout = QVBoxLayout(main_widget)

        tabs = QTabWidget()
        main_tab = BackgroundWidget(BACKGROUND_IMAGE_BASE64)
        settings_tab = QWidget()
        tabs.addTab(main_tab, "Main")
        tabs.addTab(settings_tab, "Settings")

        main_layout = QVBoxLayout()
        main_tab.setLayout(main_layout)

        url_layout = QHBoxLayout()
        self.url_input = QLineEdit()
        self.url_input.setPlaceholderText("Enter YouTube URL...")
        analyze_btn = QPushButton("Analyze")
        analyze_btn.clicked.connect(self.start_analysis)
        url_layout.addWidget(self.url_input)
        url_layout.addWidget(analyze_btn)

        self.status_label = QLabel("Ready")
        self.status_label.setAlignment(Qt.AlignCenter)
        self.status_label.setFont(QFont("Consolas", 16))

        self.progress_bar = QProgressBar()
        self.progress_bar.setValue(0)
        self.progress_bar.setAlignment(Qt.AlignCenter)

        main_layout.addLayout(url_layout)
        main_layout.addWidget(self.status_label)
        main_layout.addWidget(self.progress_bar)

        settings_layout = QVBoxLayout(settings_tab)

        api_key_layout = QVBoxLayout()
        api_key_label = QLabel("OpenAI API Key:")
        self.api_key_input = QLineEdit()
        self.api_key_input.setEchoMode(QLineEdit.Password)
        save_key_btn = QPushButton("Save API Key")
        save_key_btn.clicked.connect(self.save_config)

        api_key_layout.addWidget(api_key_label)
        api_key_layout.addWidget(self.api_key_input)
        api_key_layout.addWidget(save_key_btn)

        ai_instructions_layout = QVBoxLayout()
        ai_instructions_label = QLabel("AI Instructions:")
        self.ai_instructions_input = QTextEdit()
        self.ai_instructions_input.setMinimumHeight(400)
        self.ai_instructions_input.setPlaceholderText(
            "Enter your custom AI instructions here...\nVideo transcription will automatically be included."
        )
        save_instructions_btn = QPushButton("Save AI Instructions")
        save_instructions_btn.clicked.connect(self.save_ai_instructions)

        ai_instructions_layout.addWidget(ai_instructions_label)
        ai_instructions_layout.addWidget(self.ai_instructions_input)
        ai_instructions_layout.addWidget(save_instructions_btn)

        settings_layout.addLayout(api_key_layout)
        settings_layout.addLayout(ai_instructions_layout)
        settings_layout.addStretch()

        layout.addWidget(tabs)

        self.setFixedSize(800, 700)

    def load_config(self):
        config = configparser.ConfigParser()
        if os.path.exists('config/config.ini'):
            config.read('config/config.ini')
            if 'OpenAI' in config:
                self.api_key_input.setText(config['OpenAI'].get('api_key', ''))

        if os.path.exists('config/prompt.ini'):
            with open('config/prompt.ini', 'r') as f:
                prompt_text = f.read()
                self.ai_instructions_input.setPlainText(prompt_text)

    def save_config(self):
        if not os.path.exists('config'):
            os.makedirs('config')

        config = configparser.ConfigParser()
        config['OpenAI'] = {'api_key': self.api_key_input.text()}

        with open('config/config.ini', 'w') as f:
            config.write(f)

        QMessageBox.information(self, "Success", "API key saved successfully!")

    def save_ai_instructions(self):
        if not os.path.exists('config'):
            os.makedirs('config')
        prompt_text = self.ai_instructions_input.toPlainText()
        with open('config/prompt.ini', 'w') as f:
            f.write(prompt_text)
        QMessageBox.information(self, "Success", "AI Instructions saved successfully!")

    def start_analysis(self):
        if not self.url_input.text():
            QMessageBox.warning(self, "Error", "Please enter a YouTube URL!")
            return

        if not self.api_key_input.text():
            QMessageBox.warning(self, "Error", "Please enter your OpenAI API key in Settings!")
            return

        self.worker = WorkerThread(self.url_input.text(), self.api_key_input.text())
        self.worker.progress.connect(self.update_status)
        self.worker.finished.connect(self.analysis_complete)
        self.worker.error.connect(self.handle_error)
        self.worker.start()

    def update_status(self, percentage, message):
        self.status_label.setText(message)
        self.progress_bar.setValue(percentage)

    def analysis_complete(self, report_path):
        self.status_label.setText("Analysis complete!")
        self.progress_bar.setValue(100)
        webbrowser.open(report_path)

    def handle_error(self, error_message):
        self.status_label.setText("Ready")
        self.progress_bar.setValue(0)
        QMessageBox.critical(self, "Error", f"An error occurred: {error_message}")


if __name__ == '__main__':
    app = QApplication(sys.argv)
    window = MainWindow()
    window.show()
    font = QFont()
    font.setPointSize(10)
    app.setFont(font)
    sys.exit(app.exec_())
